import{_ as p,c as i,o as t,a1 as o}from"./chunks/framework.BwTyoF0R.js";const f=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"works/1.md","filePath":"works/1.md"}'),e={name:"works/1.md"},l=o("<p>Tip: Markdown 功能介绍 Markdown 是一种使用纯文本编写的标记语言，它可以产生格式丰富的页面排版效果，比如突出标题、加粗、斜体、列表、引用等。我们支持了所见即所得的 Markdown 功能。你可以手动输入 Markdown 语法使用，也可以先选择文本再点击功能按钮快速将文本变成相关的 Markdown 样式。</p><ol><li><p>标题 使用“#”加空格在行首来创建标题，例如：#空格一级标题，##空格二级标题，###空格三级标题。效果： 一级标题 二级标题 三级标题</p></li><li><p>加粗 使用一组双星号“**”加空格来加粗一段文字，例如：<strong>加粗的文字</strong>空格。效果： 加粗的文字</p></li><li><p>斜体 使用使用一组单星号“*”加空格来将一段文字变为斜体，例如：<em>斜体的文字</em>空格。效果： 斜体的文字</p></li><li><p>下划线 使用一组下划线“_”加空格来将一段文字标记下划线，例如：_被标记下划线的文字_空格。效果： 被标记下划线的文字</p></li><li><p>删除线 使用一组“-”加空格来将一段文字标记删除线，例如：-被标记删除线的文字-空格。效果： 被标记删除线的文字</p></li><li><p>无序列表 使用“-”、“*”或“+”加空格在行首来创建无序列表 ，例如：-空格这是一个无序列表； +空格这是一个无序列表；*空格这是一个无序列表。效果： 这是一个无序列表 这是一个无序列表 这是一个无序列表</p></li><li><p>有序列表 使用数字圆点加空格在行首如“1. ”、“2. ”来创建有序列表 ，例如：1. 这是一个有序列表 ；2. 这是一个有序列表；3. 这是一个有序列表。效果：</p></li><li><p>这是一个有序列表</p></li><li><p>这是一个有序列表</p></li><li><p>这是一个有序列表</p></li><li><p>引用 使用“&gt;”在段首来引用一段文字，例如：&gt;空格这是一段引用。效果： 这是一段引用</p></li></ol><p>写作功能介绍</p>",3),_=[l];function a(r,s,n,c,d,m){return t(),i("div",null,_)}const w=p(e,[["render",a]]);export{f as __pageData,w as default};
